const rootElement = document.getElementById('root');
ReactDOM.render(
    <React.StrictMode>
        <BrowserRouter> {/* Ensure BrowserRouter is at the top level */}
            <App />
        </BrowserRouter>
    </React.StrictMode>,
    rootElement
